import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-url-info',
  templateUrl: './url-info.component.html',
  styleUrls: ['./url-info.component.css']
})
export class UrlInfoComponent implements OnInit {

  displayedColumns: string[] = ['Id', 'LongUrl', 'Shorened Url', 'Date of creation', 'Owner id'];
  dataSource: any;

constructor(private activatedRoute: ActivatedRoute) {}

  ngOnInit(): void {
    this.activatedRoute.paramMap.subscribe((res) => {
      const id = res.get('id');
      console.log(id);
    })
  }

}
